import React from "react";
import '../css/AuthForm.css'
import '../js/AuthForm.js'

function AuthForm() {
    return (
        <div className="formBoxDiv">
            <ul className="formBox">
                <li><input id="inputId" type="text" placeholder="아이디 입력"/> </li>
                <li><input type="password" placeholder="패스워드 입력"/> </li>
                <li>
                    <button>인증번호 보내기</button>
                </li>
            </ul>
        </div>
    )
}

export default AuthForm;
